function MyButton() {
  return <button>I'm a button</button>;
}

function AboutPage() {
  return (
    <>
      <h1>Moring Krishna, Welcome to my first app</h1>
      <p>
        Hello there.
        <br />
        How do you do?
      </p>
    </>
  );
}

export default function MyApp() {
  return (
    <div>
      <AboutPage />
      <MyButton />
    </div>
  );
}
